function mgntPopup(titleInfos,content,callback,submitFct,submitTxt,submitBgColor,submitTxtColor,isWide, updateWidthPopup){
    var title;
    var id =  null;
    if(Array.isArray(titleInfos)){
        title = titleInfos[0];
        id = titleInfos[1];
    }else{
        title = titleInfos;
    }

    var popup = $('#mgntOverlayPopup');
    // if(isWide){
    //     popup = $('#fullOverlayWidePopup');
    // }

    if(id != null){
        popup.attr('class',id);
    }else{
        popup.attr('class','');
    }

    popup.find('#mgntOverlayPopupTitle').html(title);
    popup.find('#mgntOverlayPopupContent .content').html(content);

    var y = 0;

    popup.find('#mgntOverlayPopupTitle').css('margin-top',(y + 15)+'px');
    popup.find('#mgntOverlayPopupClose').css('top',y+'px');
    if(submitFct){
        popup.find('#mgntOverlayPopupSubmit').css('display','block');
        //popup.find('#mgntOverlayPopupSubmit a').attr('href',submitFct);
        popup.find('#mgntOverlayPopupSubmit').off().click(submitFct);
        popup.find('#mgntOverlayPopupSubmit').html(submitTxt);
        if(submitBgColor){
            popup.find('#mgntOverlayPopupSubmit').css("background-color",submitBgColor);
        }
        if(submitTxtColor){
            popup.find('#mgntOverlayPopupSubmit').css("color",submitTxtColor);
        }
    }else{
        popup.find('#mgntOverlayPopupSubmit').css('display','none');
        popup.find('#mgntOverlayPopupSubmit a').attr('href',"javascript:void(0)");
        popup.find('#mgntOverlayPopupSubmit a').html("");
    }
    popup.css('display','block');

    var windowH = $(window).height();

    var rest = 102 + 15;

    var visibleMenuH = windowH - rest - 10;
    //popup.find('#mgntOverlayPopupContent').css('height',visibleMenuH+'px');
    if(callback)
    {
        callback();
    }

    if(updateWidthPopup) {
        $('#mgntOverlayPopupContainer').addClass('updateWithPopup');
    }

    replaceMgntPopup();
    window.onresize = replaceMgntPopup;
}

function replaceMgntPopup(){
    var popup = $('#mgntOverlayPopup');

    // popup.find('#mgntOverlayPopupContent').css('height','inherit');

    var popupW = popup.find('#mgntOverlayPopupContent').innerWidth();
    var windowW = $(window).innerWidth();
    var windowH = $(window).innerHeight();
    var popupH = popup.find('#mgntOverlayPopupContent').innerHeight();

    var ml = (windowW - popupW)/2;
    if(ml<=1){
        ml = 0;
    }
    // popup.find('#mgntOverlayPopupTitle').css('margin-left',ml+'px');
    popup.find('#mgntOverlayPopupContainer').css('left',ml+'px');

    if((windowH - 75) < popupH){
        popup.find('#mgntOverlayPopupContainer').css('top','0px');
        popup.find('#mgntOverlayPopupTitle').css('margin-top','0px');
        popup.find('#mgntOverlayPopupContent').css('height',windowH+'px');
    }else{
        popup.find('#mgntOverlayPopupContainer').css('top','75px');
        popup.find('#mgntOverlayPopupTitle').css('margin-top','15px');
        popup.find('#mgntOverlayPopupContent').css('height','inherit');
    }
    // popup.find(".nano").nanoScroller();

    popup.find("#mgntOverlayPopupContent").overlayScrollbars(
        {
            className       : "os-theme-dark",
            resize          : "both",
            sizeAutoCapable : true,
            paddingAbsolute : true,
            scrollbars : {
                clickScrolling : true
            }
    });

    // $('body').addClass('noScroll');
}

function closeMgntPopup()
{
    $('#mgntOverlayPopup').css('display','none');
    $('#mgntOverlayWidePopup').css('display','none');
    $('#cmsBookingPopup').css('display','none');
    $('body').removeClass('noScroll');
}
